import React from "react";

export default class projects {
  render() {
    return (
        <section id="projects">
        <div className="projects-heading">
          <span className="projects-heading-text">About Me!</span>
          <span className="projects-subheading">Brief Introduction</span>
        </div>
        </section>
    )
  }
}
